import React from 'react';
import NavigationBar from '../components/NavigationBar';
import HomeContent from '../components/HomeContent';

const HomePage = ({user}) => {
  if(user.type === 'mentor'){
    return (
      <div style={{ width:'100%', height:'100%'}}>
        <NavigationBar />
        <div style={{padding: "10px", width: '98%'}}>
          <h1> Hello {user.userName} ! </h1>
          <h3>Pnding Requestes:</h3>
          <HomeContent list={user.pendingMentees}/>
          <h3>Active :</h3>
          <HomeContent list={user.approvedMentees}/>
          <h3>Finished :</h3>
          <HomeContent list={user.finishedMentees?.userName}/>
          <h3>Declined :</h3>
          <HomeContent list={user.declinedMentees}/>
        </div>
      </div>
    );
  }
  else{
    return (
      <div style={{ width:'100vw', height:'100vh'}}>
        <NavigationBar />
        <h1> Hello {user.userName} ! </h1>
        <HomeContent list={user.currentMentor}/>
      </div>
    );
  }
};

export default HomePage;
